import React from "react";

function CreateMyCampaignForm() {
  return (
    <section>
      <h1>CREATE YOUR CAMPAIGN</h1>
      <form>
        <label htmlFor="minimum-donation">Minimum Donation:</label>
        <input name="minimum-donation" type="text"></input>
        <label htmlFor="name-ngo-individual">Name (NGO/Individual):</label>
        <input name="name-ngo-individual" type="text"></input>
        <label htmlFor="misson-objective">Mission/Objective:</label>
        <input name="misson-objective" type="text"></input>
        <label htmlFor="target-amount">Target Amount:</label>
        <input name="target-amount" type="text"></input>
        <label htmlFor="metamask-wallet-address">MetaMask Wallet Address:</label>
        <input name="metamask-wallet-address" type="text"></input>
        <label htmlFor="infor-mail info-phone">Contact Information:</label>
        <input name="info-mail" type="email" placeholder="Email"></input>
        <input name="info-phone" type="text" placeholder="Phone Number"></input>
      </form>
    </section>
  );
}

export default CreateMyCampaignForm;
